import 'bootstrap/dist/css/bootstrap.min.css'
import {BrowserRouter,Routes,Route} from 'react-router-dom'
import Cars from './Cars';
function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <Routes>
          <Route path='/' element = { <Cars></Cars>}></Route>
        </Routes>
      </BrowserRouter>
      hgjuggu
    </div>
  );
}

export default App;
